import axios from 'axios';
import './App.css';
import { useState } from 'react';


function App() {
  const [videos, setVideos] = useState([]);
  const [userInput, setUserInput] = useState('');
  const [loading, setLoading] = useState(false);

  const fetchMatchingEpisodes = async (e) => {
    e.preventDefault();
    setVideos([])
    try {
      const response = await axios.get('http://localhost:3001/api/getMatchingCaptions', {
        params: {
          'userInput': userInput,
        }
      });

      if (response.status === 200) {
        setVideos(response.data)
      }
    } catch (error) {
      console.error(`Error fetching captions for ${e.target.value}:`, error);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <p className='pageTitle'>DEUX PRINCES</p>

        <p className='pageSubTitle'>« Te rappelles-tu quand Thomas a dit...? »</p>
        <p className='pageSubTitle2'>« C'est dans quel épisode que Phil parle de...? »</p>

        <form onSubmit={fetchMatchingEpisodes} disabled={loading}>
          <div className='formContainer'>
            <div className='box input_field'>
              <i id='icon' class="fa-solid fa-magnifying-glass"></i>
              <input className='input_field_inner' value={userInput} onChange={(e) => setUserInput(e.target.value)} type='text' placeholder={''}></input>
            </div>
            <p>{userInput}</p>

            <div className='input_box'>
              <input className='box input_btn' type='submit' value={'Chercher'}></input>
            </div>
          </div>
        </form>

        <div className='videosContainer'>
          {videos.length === 0 ? videos.map((video) => (
            <div className='videoItemBox'>
              <a className='videoItemLink' target="_blank" rel="noopener noreferrer" href={video.info.originalUrl}>
                <img className='videoItemImg' src={video.info.thumbnail} alt={video.info.title} />
              </a>
              <h3 className='videoItemTitleLbl'>« {video.info.title.substring(15)} »</h3>
              
              <div className='timestampList'>
              {video.captions.map((caption, index) => (
                <>
                <div key={index} className='timestampItem'>
                  <div className="timestampTitle">{caption.text} <span className='timestampHighlighted'>Ethan Klein</span> was like</div>
                  <div className="timestampTime">{caption.startTime}</div>
                  <i id='timestampIcon' class="fa-solid fa-arrow-up-right-from-square"></i>
                </div>
                </>
              ))}
                <div className='timestampItem'>
                  <div className="timestampTitle">so she, so <span className='timestampHighlighted'>Ethan Klein</span> f d f dfdf df df fdjsf fhdksf hfkds hjfds hfksdhjhf came out and was like</div>
                  <div className="timestampTime">19:34</div>
                  <i id='timestampIcon' class="fa-solid fa-arrow-up-right-from-square"></i>
                </div>
                <div className='timestampItem'>
                  <div className="timestampTitle">cloud nine. I'm good, man. Yeah, it's a little too,</div>
                  <div className="timestampTime">28:53</div>
                  <i id='timestampIcon' class="fa-solid fa-arrow-up-right-from-square"></i>
                </div>
                <div className='timestampItem'>
                  <div className="timestampTitle">it's like the carnival worker, the carnival working man. Hilarious</div>
                  <div className="timestampTime">33:45</div>
                  <i id='timestampIcon' class="fa-solid fa-arrow-up-right-from-square"></i>
                </div>
              </div>
            </div>
          )) : <></>}
        </div>
      </header>
    </div>
  );
}

export default App;
